                                        <img alt="a screen shot of a man" data-src="{&quot;default&quot;:{&quot;load&quot;:&quot;default&quot;,&quot;w&quot;:&quot;80&quot;,&quot;h&quot;:&quot;45&quot;,&quot;src&quot;:&quot;//img-s-msn-com.akamaized.net/tenant/amp/entityid/BB19Sos4.img?h=450&amp;w=799&amp;m=6&amp;q=60&amp;o=f&amp;l=f&amp;x=477&amp;y=296&quot;},&quot;size3column&quot;:{&quot;load&quot;:&quot;default&quot;,&quot;w&quot;:&quot;62&quot;,&quot;h&quot;:&quot;35&quot;,&quot;src&quot;:&quot;//img-s-msn-com.akamaized.net/tenant/amp/entityid/BB19Sos4.img?h=352&amp;w=624&amp;m=6&amp;q=60&amp;o=f&amp;l=f&amp;x=477&amp;y=296&quot;},&quot;size2column&quot;:{&quot;load&quot;:&quot;default&quot;,&quot;w&quot;:&quot;62&quot;,&quot;h&quot;:&quot;35&quot;,&quot;src&quot;:&quot;//img-s-msn-com.akamaized.net/tenant/amp/entityid/BB19Sos4.img?h=352&amp;w=624&amp;m=6&amp;q=60&amp;o=f&amp;l=f&amp;x=477&amp;y=296&quot;}}" src="//static-entertainment-neu-s-msn-com.akamaized.net/sc/9b/e151e5.gif" />
