                                <div>
                                    <p>
                                        UPDATE: 4:06 - The Major Crimes Unit of Baldwin County (BCMCU) has identified the victims of this incident.
                                    </p>
                                    <p>
                                        The victims were Ryan Frazier and Joshua Carroll, according to the BCMCU. Both of them were from Seattle, Washington.
                                    </p>
                                    <p>
                                        BCMCU says both of the men were performing contract work to install fiberoptic cable in the area.
                                    </p>
                                    <p>
                                        The investigation is still active, and investigators are currently out in the field following up on leads, BCMCU says.
                                    </p>
                                    <p>
                                        Anyone with information on Frazier or Carroll is asked to call BCMCU at 251-972-8589.
                                    </p>
                                    <p>---</p>
                                    <p>
                                        Authorities offer update on double homicide after two  male bodies reported found laying in County Road 95 near Elberta: 
                                        [To skip straight to the interview, go to 32:10]
                                    </p>
                                    <p>
                                    <div>

                                        <div class="fb-post fb-em-advph" data-href="https://www.facebook.com/mynbc15/videos/340061397259616/"  data-width="500">
                                            <blockquote cite="https://www.facebook.com/mynbc15/videos/340061397259616/" 
                                                        class="fb-xfbml-parse-ignore">
                                                <p>Related Facebook post</p>
                                                <a href="https://www.facebook.com/mynbc15/videos/340061397259616/" 
                                                   target="_blank" 
                                                   data-id="76" 
                                                   data-m='{"i":76,"p":73,"n":"partnerLink","y":24,"o":3}'>
                                                    Shared from Facebook
                                                </a>
                                            </blockquote>
                                        </div>
                                    </div>
                                </p>
                                <p>
                                    Elberta police confirm the case is being treated as a homicide. A newspaper delivery person called 911 after finding the bodies.
                                </p>
                                <p>
                                <div>

                                        <div class="fb-post fb-em-advph" data-href="https://www.facebook.com/mynbc15/videos/780258709421605/"  data-width="500">
                                            <blockquote cite="https://www.facebook.com/mynbc15/videos/780258709421605/" class="fb-xfbml-parse-ignore"><p>Related Facebook post</p><a href="https://www.facebook.com/mynbc15/videos/780258709421605/" target="_blank" data-id="77" data-m='{"i":77,"p":73,"n":"partnerLink","y":24,"o":4}'>Shared from Facebook</a></blockquote>
                                        </div></div></p><p>According to Baldwin Co Sheriff's office, the Baldwin County Major Crimes Unit is currently working an incident involving two individuals who have been found deceased on County Road 95, south of Elberta. progresses.</p>              <p>NBC 15 is on scene. This is a developing story, and we are working to get more information.</p></div>
